import React from 'react';
import '../css/RegisterForm.css';
import Logo from '../icons/logo.svg';

interface FormData {
    IIN: string,
    username: string,
    password: string,
    confirmPassword: string
}

const RegisterForm: React.FC = () => {
    const [] = useState<FormData>({

    });



    return (
        <div className="body_form">
        <div className="registration-form">
        {/* Логотип */}
        <img src={Logo} alt="Логотип" className="w-90 h-90 mx-auto" />
        <h2>Регистрация</h2>
        <form onSubmit=''>
            <div className="form-group">
                <label htmlFor="iin">ИИН</label>
                <input type="text" id="iin" name="iin" maxLength={12} required pattern="\d{12}" placeholder="Введите ваш ИИН" />
            </div>
            <div className="form-group">
                <label htmlFor="username">Имя пользователя</label>
                <input type="text" id="username" name="username" required pattern="\d{4}" placeholder="Введите ваше имя пользователя" />
            </div>
            <div className="form-group">
                <label htmlFor="password">Пароль</label>
                <input type="password" id="password" name="password" required placeholder="Введите пароль" />
            </div>
            <div className="form-group">
                <label htmlFor="confirmPassword">Подтвердите пароль</label>
                <input type="password" id="confirmPassword" name="confirmPassword" required placeholder="Подтвердите пароль" />
            </div>
            <div className="form-group">
                <button type="submit">Зарегистрироваться</button>
            </div>
            <div className="form-footer">
                Уже есть аккаунт? <a href="LoginForm">Войти</a>
            </div>
        </form>
    </div>
    </div>
    );
}

export default RegisterForm;
